import {createRouter, createWebHistory} from 'vue-router'


const routes = [
    {
        name: 'HomePage',
        path: '/',
        componnent: HomePage
    },
    {
        name: 'ClientList',
        path: '/clients',
        componnent: ClientList
    }
]

const router = createRouter({
    history: createWebHistory(), routes
})

export default router;
